import React from 'react';
import ReactDOM from 'react-dom/client';

const root = ReactDOM.createRoot(document.getElementById('root'));

function message(props)
{
  return <h1>{props.msg}</h1>
}

const element = <div>
   {message("Hello World")}
</div>

root.render(element);
